SkyTrack turns your iPhone or iPad in to your own personal air traffic control radar, flight tracker, and aiport departurs and arrivals boards. Flights are displayed in real-time on beautiful maps near you or anywhere in the world. Track the flights of your family and friends or just watch the aircraft fly around the world in real time.

We are passionate about providing innovative flight tracking apps and are excited about the new features and functionality we are developing to enhance the app. Contact us for any features or improvements you would like to see incorporated.

FEATURES
• See aircraft fly all over the world 
• Track flights by flight number, aircraft registration or by airport arrivals / departures or en route between airports;
• See departures and arrivals board world-wide;
• Organise your flights into trips and store them in the flight log;
• Follow your flight in real time and zoom out to see the flight route, see actual path and scheduled waypoints in real time;
• Easy access to full flight details such as flight number, airline, aircraft type and tail number, photo (where available);

Enhance your flight tracking with either the Professional or Premium subscription upgrade.

PROFESSIONAL AND PREMIUM FEATURES
• Access to a professional grade flight data source having a much lower data latency, more frequent updates, and using a wider map;
• See airport departure and arrivals within 24 hours;
• Enjoy the 3D pilots view to see the world as if you are right there in the cockpit;
• Quickly visualise the type of aircraft on your map display with over 40 realistic aircraft icons;
• Includes realistic shadows that change with the local time of day, season and location;
• See the recent flights flown by the aircraft;
• Unlock altitude tracks to quickly see if the plane is climbing, cruising or descending;
• Removal of all adverts.

Professional and Premium are automatic renewal subscriptions. There is no commitment, you can cancel at any time. Payment will be charged to the iTunes account on the purchase confirmation. The subscription is automatically renewed unless the automatic renewal is deactivated at least 24 hours before the end of the current period. The account will be charged for renewal within 24 hours prior to the end of the current period, and will identify the cost of the renewal. Subscriptions can be managed by the user and automatic renewal can be deactivated by going to the User Account Settings after purchase. Any unused portion of a free trial period, if offered, will be lost when the user purchases a subscription to that publication, where applicable.

